import React from 'react'
import Result from './Result'

function Results({ results, openPopup }) {
  return (
    <section className="results">
        {results.map(result => (
            <Result key={result.imdbID} result={result} onClick={openPopup} />
        ))};
    </section>
  )
}

export default Results
